    false,nt"url": null,nt"notes": "The National Status and Trends (NS&T) Benthic
    Surveillance Project Chemistry data file reports the trace concentrations of a suite
    of chemical contaminants in marine sediment and benthic fish tissue samples collected
    from all U.S. coastal regions from 1984 to 1992. The sediment and tissue samples
    were analyzed for major and trace elements and a suite of organic chemical constituents,
    including butyltins, polycyclic aromatic hydrocarbons (PAHs), polychlorinated biphenyls
    (PCBs), and pesticides. The Benthic Surveillance Project Tissue Chemistry file is
    constructed as a vertically formatted table.",nt"owner_org": "e811f0b4-451f-4896-9e8f-fc6802837819",nt"extras":
